function constructBody() {
  let colCount = singleColumn
    ? parseInt(data.config.colCount)
    : columnList.length;

  let currColumn = 0;
  let lastColumn = colCount - 1;
  let firstColumn = 0;
  let bodyContents = '';
  let startRowTag;
  let endRowTag;
  let currDataContents = '';
  let rowIntType = 'Row-odd';

  dataList.forEach(function(item) {
    itemCustomStyle =
      item.bodyCustStyle == '' || item.bodyCustStyle == null
        ? ''
        : item.bodyCustStyle;
    currDataContents =
      '' +
      constructHtmlContents(item) +
      '';

    startRowTag =
      currColumn == firstColumn ? '
' : '';
    endRowTag = currColumn == lastColumn ? '' : '';
    bodyContents += startRowTag + currDataContents + endRowTag;

    rowIntType =
      currColumn == firstColumn
        ? rowIntType == 'Row-odd'
          ? 'Row-even'
          : 'Row-odd'
        : rowIntType;
    firstColumn = currColumn == lastColumn ? lastColumn + 1 : firstColumn;
    lastColumn = currColumn == lastColumn ? lastColumn + colCount : lastColumn;

    currColumn++;
  });

  return bodyContents;
}

function constructHtmlContents(tableData) {
  let response = '';
  let elementCustStyle =
    tableData.elementCustStyle == '' || tableData.elementCustStyle == null
      ? ''
      : tableData.elementCustStyle;
  var linkTarget = '',
    linkHref = '';
  let linkStartTag = '',
    linkEndTag = '';
  if (tableData.Link) {
    linkTarget = tableData.Link.target
      ? 'target="' + tableData.Link.target + '"'
      : '';
    linkHref = tableData.Link.href ? tableData.Link.href : '';
    linkStartTag = '';
    linkEndTag = '';
  }

  switch (tableData.dataType) {
    case 'txt':
      //response = '
' + tableData.dataText + '';
      response =
        linkStartTag +
        '
' +
        tableData.dataText +
        '' +
        linkEndTag;
      break;
    case 'img':
      response =
        linkStartTag +
        '' +
        linkEndTag;
      break;
    case 'icon':
      response = linkStartTag + tableData.dataIcon + linkEndTag;
      break;
    case 'btn':
      response =
        linkStartTag +
        '
' +
        tableData.dataButtonText +
        ' ' +
        linkEndTag;
      break;
    case 'lrgtxt':
      response =
        linkStartTag +
        '
' +
        tableData.dataLargeText +
        '' +
        linkEndTag;
      break;
    default:
      response = '
Default Text';
  }

  return response;
}

